import './App.css';

import { useApi } from './hooks/use-api';
import {useState} from 'react';

const [count, setCount] = useState(0);

function handleClick(){
  setCount(count+1);
}


function Hey(){
  return(
    <button className='heyButton' onClick={handleClick}>
      This it + {count}
    </button>
   );
  }


function App() {
  const { response } = useApi();

  return (
    <div className="App">
      <header className="App-header">
        <Hey/>
        <p>
          {response}
        </p>
      </header>
    </div>
  );
}

export default App;
